CREATE DEFINER=`root`@`localhost` PROCEDURE `Actualizar_Invitado` (IN `p_nombre` TINYTEXT, IN `p_apellido` TINYTEXT, IN `p_telefono` BIGINT, IN `p_numDocumento` BIGINT, IN `p_correo` TINYTEXT, IN `p_idParqueaderoFk` SMALLINT, IN `p_placaVehiculo` VARCHAR(255), IN `p_tiempoParqueadero` TIME, IN `p_idApartamentoFK` INT)   BEGIN
    DECLARE v_idInvitado SMALLINT;

    -- Obtener solo un idInvitado, el primero que coincida con el numDocumento
    SELECT idInvitado INTO v_idInvitado 
    FROM invitado 
    WHERE idPersonasFK = p_numDocumento
    LIMIT 1;

    -- Actualizar la tabla personas
    UPDATE personas
    SET nombre = p_nombre,
        apellido = p_apellido,
        telefono = p_telefono,
        correo = p_correo,
        idParqueaderoFk = p_idParqueaderoFk,
        placaVehiculo = p_placaVehiculo
    WHERE numDocumento = p_numDocumento;

    -- Actualizar la tabla invitado
    UPDATE invitado
    SET tiempoParqueadero = p_tiempoParqueadero
    WHERE idInvitado = v_idInvitado;

    -- Actualizar la tabla invitado_apartamento
    UPDATE invitado_apartamento
    SET idApartamentoFK = p_idApartamentoFK
    WHERE idInvitadoFk = v_idInvitado;
    
END$$

