CREATE DEFINER=`root`@`localhost` PROCEDURE `Inserción_Invitado` (IN `p_nombre` TINYTEXT, IN `p_apellido` TINYTEXT, IN `p_telefono` BIGINT, IN `p_numDocumento` BIGINT, IN `p_correo` TINYTEXT, IN `p_idParqueaderoFk` SMALLINT, IN `p_placaVehiculo` VARCHAR(255), IN `p_tiempoParqueadero` TIME, IN `p_idApartamentoFK` INT)   BEGIN
    -- Declarar variables al inicio
    DECLARE lastInvitadoID SMALLINT;

    -- Insertar en la tabla personas
    INSERT INTO personas (nombre, apellido, telefono, numDocumento, correo, idParqueaderoFk, placaVehiculo)
    VALUES (p_nombre, p_apellido, p_telefono, p_numDocumento, p_correo, p_idParqueaderoFk, p_placaVehiculo)
    ON DUPLICATE KEY UPDATE nombre = p_nombre, apellido = p_apellido, telefono = p_telefono, correo = p_correo, idParqueaderoFk = p_idParqueaderoFk, placaVehiculo = p_placaVehiculo;

    -- Insertar en la tabla invitado
    INSERT INTO invitado (idPersonasFK, tiempoParqueadero)
    VALUES (p_numDocumento, p_tiempoParqueadero);

    -- Obtener el id del último invitado insertado
    SET lastInvitadoID = LAST_INSERT_ID();

    -- Insertar en la tabla invitado_apartamento
    INSERT INTO invitado_apartamento (idInvitadoFk, idApartamentoFK)
    VALUES (lastInvitadoID, p_idApartamentoFK);
    
END$$

