--
-- Disparadores `propietario`
--
DELIMITER $$
CREATE TRIGGER `control_espacios_parqueadero` AFTER UPDATE ON `propietario` FOR EACH ROW begin
	if new.mesesAtrasados >= 12 then         /* Si la cantidad de meses atrazados con el pago de administración es igual o mayor a 12,
												el espacio que esta a nombre de él debe ser pesto en estado libre. */
		update personas set idParqueaderoFk = null, 
			   placaVehiculo = null where idPersonas = 
               (Select idPersonaFk from personas_cuenta where idPersonaCuenta = 
				(select idPersonaCuentaFK from propietario where idPropietario = new.idPropietario));
    end if;
end
$$
DELIMITER ;

