DROP TABLE IF EXISTS `get_citassalon`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `get_citassalon`  AS SELECT `p`.`numDocumento` AS `numDocumento`, `p`.`nombre` AS `nombre`, `p`.`apellido` AS `apellido`, `pr`.`Apartamento_FK` AS `Apartamento_FK`, `c`.`Fecha` AS `Fecha`, `c`.`horarioInicio` AS `horarioInicio`, `c`.`horarioFin` AS `horarioFin` FROM (((`personas` `p` join `personas_cuenta` `pc` on((`p`.`numDocumento` = `pc`.`idPersonaFk`))) join `propietario` `pr` on((`pc`.`idPersonaCuenta` = `pr`.`idPersonaCuentaFK`))) join `citas_salon_comunal` `c` on((`pr`.`idPropietario` = `c`.`idPropietarioFK`))) ;

