CREATE DEFINER=`root`@`localhost` EVENT `archivar_citas_salon_comunal` ON SCHEDULE EVERY 1 MONTH STARTS '2024-09-07 20:27:28' ON COMPLETION NOT PRESERVE ENABLE DO Insert into archived_citas_salon_comunal (Select * from citas_salon_comunal where fechaAlquiler < current_date())$$

CREATE DEFINER=`root`@`localhost` EVENT `citas_salon_comunal` ON SCHEDULE EVERY 1 WEEK STARTS '2024-09-07 20:13:34' ON COMPLETION NOT PRESERVE ENABLE DO insert into citas_salon_comunal_tabla (Numero_Citas, Fecha_Registro)
    values ((Select count(*) from citas_salon_comunal), current_date())$$

CREATE DEFINER=`root`@`localhost` EVENT `Informe_espacios_parqueadero` ON SCHEDULE EVERY 1 WEEK STARTS '2024-09-07 20:43:28' ON COMPLETION NOT PRESERVE ENABLE DO insert into informe_espacios_parqueadero (cantidadEspaciosAlquilados, fechaInforme) 
    values ((Select count(*) from espacios_parqueadero where idEstadoFK = 2), current_date())$$

CREATE DEFINER=`root`@`localhost` EVENT `informe_meses_atrasados` ON SCHEDULE EVERY 1 MONTH STARTS '2024-09-07 20:39:25' ON COMPLETION NOT PRESERVE ENABLE DO insert into informe_meses_atrasados (TotalMesesAtrasados, FechaInforme) values ( /* Insertará en la tabla informe_meses_atrasados los datos de */
        (Select sum( /* la suma de los meses atrasados de todos los propietarios */
            (Select sum(mesesAtrasados * 90000) from propietario /* donde se cobrará 90.000 si este tiene rentado un espacio de parqueadero */
            where idPersonaCuentaFK in (Select pc.idPersonaCuenta from personas_cuenta pc
            inner join personas p on pc.idPersonaFk = p.idPersonas
            where idParqueaderoFk is not null)))
        +
        (Select sum(mesesAtrasados * 60000) from propietario /* o 60.000 si no tiene un espacio alquilado */
        where idPersonaCuentaFK not in(Select pc.idPersonaCuenta from personas_cuenta pc
        inner join personas p on pc.idPersonaFk = p.idPersonas
        where idParqueaderoFk is not null))
        from propietario),
        current_date() /* También insertará la fecha de creación del informe */
    )$$

CREATE DEFINER=`root`@`localhost` EVENT `purga_solicitudes` ON SCHEDULE EVERY 1 MINUTE STARTS '2024-09-07 20:28:48' ON COMPLETION NOT PRESERVE ENABLE DO delete from solicitud where estado = "Atendido"$$

CREATE DEFINER=`root`@`localhost` EVENT `suma_mesesAtrasados` ON SCHEDULE EVERY 1 MONTH STARTS '2024-09-07 20:30:18' ON COMPLETION NOT PRESERVE ENABLE DO update propietario set mesesAtrasados = mesesAtrasados + 1$$

